Ext.data.JsonP['ACS_2013_11_January_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ACS 2013 11 January Release Note</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-50725336\" class=\"content\">\n                        <h1>ACS 2013 11 January Release Note</h1>\n    <p>The namespace used by the ACS SDKs for <a class=\"external-link \" href=\"https://wiki.appcelerator.org/display/~lbadenhop/Appcelerator+Platform+Services+SDK+for+Android+--+Appcelerator+ArrowDB+and+Arrow+Push\">Android</a> and <a class=\"external-link \" href=\"https://wiki.appcelerator.org/display/~lbadenhop/Appcelerator+Platform+Services+SDK+for+iOS+--+ArrowDB+and+Arrow+Push\">iOS</a> has changed from <tt class=\" \">Cocoafish</tt> to <tt class=\" \">ACSClient</tt>. The documentation and sample code has been updated to reflect this change.    </p>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725336\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 2013 11 January Release Note"});